    private fun de(string: String) {
        string.split(" ")
        val s = string.split(" ").also {
            println(string)
            println(it)
            println(it.size)
        }.map {
            it.toCharArray().reversedArray().foldIndexed(0) { index, acc, c ->
                return@foldIndexed (acc + 2.toDouble().pow(index.toDouble()) * c.toString().toDouble()).toInt()
            }
        }.map {
            Character(it.toChar())
        }.joinToString("").also(::println)

        println(s.slice(0..31))
        println(s.slice(24..31))
        println(s.slice(32 until s.length))

        println(Encrypt.desDecrypt(s.slice(32 until s.length), s.slice(0..31), s.slice(24..31)))
    }
